import React from "react";
import FormPage from "components/form";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);
    state = {
      newTest: {
        layer: { default: "", selected: "" },
        testType: { defaultTestType },
        testName: { defaultTestName },
        testDescription: { defaultTestDescription },
      },
      basicConfig: {
        target: { defaultTarget },
        protocol: { defaultProtocol },
        probing: { defaultProbing },
        pathTrace: { defaultPathTrace },
        // interval: { default: defaultInterval },
        // agents: { defaultAgents },
        // alerts: { enable: { defaultEnable }, rules: { defaultRuleSelect } },
      },
    };
  }
  render() {
    const { newTest, basicConfig } = this.state;

    return <FormPage newTest={newTest} basicConfig={basicConfig} />;
  }
}

export default App;
